        private void runButton_Click(object sender, EventArgs e)
        {
            this.Cursor = Cursors.WaitCursor;
            timeSeriesPlot.AutoRedraw = false;
            Run();
            timeSeriesPlot.AutoRedraw = true;
            timeSeriesPlot.Initialize();
            this.Cursor = Cursors.Default;
            
        }

        private void Run()
        {

            hydroCatEngine.Initialize();
            try
            {
                hydroCatEngine.RunSimulation();
            }
            catch (Exception e)
            {
                MessageBox.Show(e.Message);
            }

            timeSeriesPlot.TimeSeriesDataSet = hydroCatEngine.OutputTimeSeries;
            timeSeriesPlot.Repaint();
            parametersPropertyGrid.Refresh();
           
        }

